import React from 'react';
import './App.css';
import Pokedex from './components/Pokedex';
import Pokemon from './components/Pokemon';

function App() {
  return (
    <>
    <h1>Exercise - Pokedex</h1>
    <Pokedex />
    <Pokemon />
    </>
  );
}

export default App;
